import React, { useState, useEffect } from "react";
import SensorItem from "./SensorItem";
import { getSensors } from "./SensorService";



const mapboxgl = require('mapbox-gl/dist/mapbox-gl.js');

mapboxgl.accessToken = 'pk.eyJ1IjoiZGllZ29zYWxvbmlhIiwiYSI6ImNrcTZzY2dyejFnZGcydm12eW5oemhvMzEifQ.1jFMrHrPaucTX_LENmmWLQ';
var map = new mapboxgl.Map({
  container: 'sensor',
  style: 'mapbox://styles/mapbox/streets-v11'
});


const Sensor = () => {
  const [sensors, setSensors] = useState([]);

  const loadSensor = async () => {
    const resp = await getSensors();
    setSensors(resp.data);
  };

  useEffect(() => {
    loadSensor();
  }, []);

  return (
    <div className="row-md-4">
      {sensors.map((sensor) => {
        return <SensorItem sensor={sensor} key={sensor._id}/>;
      })}
    </div>
  );
};

export default Sensor;
